css:
.panel {
  border-radius: 0;
  border: none;
  background-color: transparent;
  box-shadow: none;
}
.panel.bordered .panel-heading {
  border-radius: 2px 2px 0 0;
}
.inset-panel .panel-heading {
  border-radius: 2px 2px 0 0;
}
.panel-heading {
  margin: 0;
  padding: 10px;
  border-radius: 0;
  font-size: 11px;
  line-height: 1;
}
.panel-heading .btn {
  height: 20px;
  line-height: 20px;
  font-size: 9px;
  position: relative;
  top: -5px;
}
atom-panel-container.left,
atom-panel-container.right {
  display: -webkit-flex;
  -webkit-flex-direction: row;
  -webkit-align-items: stretch;
  height: 100%;
}
atom-panel-container.left atom-panel,
atom-panel-container.right atom-panel {
  height: 100%;
}
atom-panel {
  display: block;
}
atom-panel.top,
atom-panel.bottom,
atom-panel.left,
atom-panel.right {
  background-color: #1d1f21;
}
.tool-panel {
  position: relative;
  background-color: #1d1f21;
}
.overlay,
atom-panel.modal {
  position: absolute;
  left: 50%;
  width: 500px;
  margin-left: -250px;
  z-index: 9999;
  box-sizing: border-box;
  color: #aaaaaa;
  background-color: #202123;
  padding: 10px;
}
.overlay h1,
atom-panel.modal h1 {
  margin-top: 0;
  color: #ffffff;
  font-size: 1.6em;
  font-weight: bold;
}
.overlay h2,
atom-panel.modal h2 {
  font-size: 1.3em;
}
.overlay atom-text-editor[mini],
atom-panel.modal atom-text-editor[mini] {
  margin-bottom: 10px;
}
.overlay .message,
atom-panel.modal .message {
  padding-top: 5px;
  font-size: 11px;
}
.overlay.mini,
atom-panel.modal.mini {
  width: 200px;
  margin-left: -100px;
  font-size: 12px;
}
.overlay.from-top,
atom-panel.modal {
  top: 0;
  border-top: none;
  border-top-left-radius: 0;
  border-top-right-radius: 0;
}
.overlay.from-bottom {
  bottom: 0;
  border-bottom: none;
  border-bottom-left-radius: 0;
  border-bottom-right-radius: 0;
}
.overlay.floating {
  left: auto;
}
